import './App.css';

function App() {
  const name = null
  return (

    <div className="App">

      {
        name ? (
          <h1> {name} </h1>
          ):
          (<div>
            <>
            <h1>
             None
            </h1>
            <h1>
            None2
            </h1>
            </></div>
            )
      }
    </div>

  );
}

export default App;
